import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";

import Table from "react-bootstrap/Table";

import Layout from "../components/Layout";
import SEO from "react-seo-component";

class OnlineClasses extends React.Component {
  render() {
    return (
      <Layout>
        {/* SEO Components */}
        <SEO
          title="Online Classes | Guide, Past Papers and Exercises"
          description={
            "Are you or others impacted by school closures? We've put together online classes to help you pass your CXC exams with CXC Spanish Online."
          }
          image={""}
          pathname={"https://www.cxcspanish.com/online-classes"}
          siteLanguage={"en"}
          siteLocale={"en"}
          twitterUsername={"_rxheem"}
        />

        <Container>
          <Breadcrumb>
            <BreadcrumbItem>
              <a href="/">Home</a>
            </BreadcrumbItem>
            <BreadcrumbItem active>Online Classes</BreadcrumbItem>
          </Breadcrumb>
          <Row>
            <Col sm={12} md={8}>
              <p>
                Are you or others impacted by school closures? We've created a
                series of free online classes to help you pass your CSEC and
                CAPE exams.{" "}
              </p>
            </Col>
            <Col sm={12} md={4}>
              <img
                style={{ width: "100%" }}
                src="https://tr4.cbsistatic.com/hub/i/r/2018/02/21/dbf0db48-453b-4907-ac90-0fdc966eb598/resize/770x/ce740824b44c5071a8deec3e7c160f31/classroomhero.jpg"
              />
              <br />
              <Card>
                <CardBody></CardBody>
              </Card>
            </Col>
          </Row>
        </Container>
      </Layout>
    );
  }
}

export default OnlineClasses;
